import React, {useContext, useEffect, useState} from 'react';
import {RenderFillContext} from "./context/renderFillContext";
import {getQueDetails} from "../../utils/getUserSurveys";

const RenderFillSurvey = () => {
	const surveyDetails = useContext(RenderFillContext).surveyData;
	// 获取问卷对应questionsDetail
	const [questions, setQuestions] = useState([]);
	useEffect(() => {
		setQuestions([]);
		const getQues = async () => {
			await Promise.all(surveyDetails.questions.map(async (question) => {
				const r = await getQueDetails(question);
				setQuestions([...questions, r]);
			}));
		};
		getQues();
		console.log(questions);

	}, [surveyDetails]);


	return (
		<fieldset>
			<h1>{surveyDetails.title}</h1>
			<h2>{surveyDetails.description}</h2>
		</fieldset>
	);
};

export default RenderFillSurvey;
